import * as React from 'react';
import { Link } from 'react-router-dom';

const Logo: React.FC = () => (
  <Link to="/" className="Logo">
    <div id="logo">
      <svg width="126" height="45" viewBox="0 0 126 45" xmlns="http://www.w3.org/2000/svg">
        <defs>
          <pattern id="pattern" preserveAspectRatio="none" width="100%" height="100%" viewBox="0 0 600 212">
            <image width="600" height="212" xlinkHref="data:image/png;base64,"/>
          </pattern>
        </defs>
        <rect id="Mobile_Create_logo_600x212" data-name="Mobile Create logo 600x212" width="126" height="45" fill="url(#pattern)"/>
      </svg>
    </div>
  </Link>
);

export default Logo;